import Navbar from '../componen/Navbar'
import Sidebar from '../componen/Sidebar'
import Feed from '../componen/Feed'
import Rightbar from '../componen/Rightbar'
const Home = () => {
    return ( 
        
            <div>
                <Navbar></Navbar> 
                <div className='Homepage'>
                    <Sidebar></Sidebar> 
                    <Feed></Feed>
                    <Rightbar></Rightbar>
                </div> 
            </div> 
    );
}
export default Home;
